import React from 'react';
import ShowTimeItem from './ShowTimeItem';
import './ShowTimeList.css'
const ShowTimeList = props =>{


        return (
          <ul className="u">
            {props.items.map(time => (
              <ShowTimeItem
                key={time._id}
                id={time.rootId}
                image="https://images.fandango.com/ImageRenderer/200/0/redesign/static/img/default_poster.png/0/images/MasterRepository/fandango/219053/Onward_Payoff-2020.jpg"
                title={time.title}
                directors={time.directors}
                time={time.showtimes}
              />
            ))}
          </ul>
        );
      };





export default ShowTimeList;
